  const [ name, setName ] = useState("");
  return (
    <Grid container spacing={2}>
      <Grid item xs={4}>
        <TextField
          style={{ marginTop: "12px" }}
          label="Student Name"
          variant="outlined"
          value={name}
          onChange={event => setName(event.target.value)}
          fullWidth
        />
      </Grid>
      <Grid item xs={4}>

      </Grid>
      <Grid item xs={4}>

      </Grid>
    </Grid>
  );
}

export default StudentFilters;
